                        // graceful disconnect sends \r\n before disposing the stream
                        // to avoid hanging connections server side
                        Console.WriteLine("Graceful disconnect...");

                        await client.GracefulDisconnectAsync().ConfigureAwait(false);
                    }
                    catch
                    {
                    }
                }
            }).Result;


            return result;
        }


